import SHOP_DATA from "../../shop-data.json";

const Shop = () => {
  return SHOP_DATA.map((item) => {
    return (
      <div>
        <h1>{item.name}</h1>
        <img src={item.imageUrl} alt={`shop item ${item.name}`} />
        <h2>{`Price : ${item.price}`}</h2>
      </div>
    );
  });
};

export default Shop;
